        <style>
            .json-formatter-row {
                  font-family: monospace;
                }
                .json-formatter-row,
                .json-formatter-row a,
                .json-formatter-row a:hover {
                  color: black;
                  text-decoration: none;
                }
                .json-formatter-row .json-formatter-row {
                  margin-left: 1rem;
                }
                .json-formatter-row .json-formatter-children.json-formatter-empty {
                  opacity: 0.5;
                  margin-left: 1rem;
                }
                .json-formatter-row .json-formatter-children.json-formatter-empty:after {
                  display: none;
                }
                .json-formatter-row .json-formatter-children.json-formatter-empty.json-formatter-object:after {
                  content: "No properties";
                }
                .json-formatter-row .json-formatter-children.json-formatter-empty.json-formatter-array:after {
                  content: "[]";
                }
                .json-formatter-row .json-formatter-string,
                .json-formatter-row .json-formatter-stringifiable {
                  color: green;
                  white-space: pre;
                  word-wrap: break-word;
                }
                .json-formatter-row .json-formatter-number {
                  color: blue;
                }
                .json-formatter-row .json-formatter-boolean {
                  color: red;
                }
                .json-formatter-row .json-formatter-null {
                  color: #855A00;
                }
                .json-formatter-row .json-formatter-undefined {
                  color: #ca0b69;
                }
                .json-formatter-row .json-formatter-function {
                  color: #FF20ED;
                }

                  background-color: rgba(0, 0, 0, 0.05);

        <style>
            .widget-box {
                	min-height: 20px;
                	background-color: #f5f5f5;
                	border: 1px solid #e3e3e3 !important;
                	border-radius: 4px;
                	-webkit-box-shadow: inset 0 1px 1px rgba(0,0,0,.05);
                	box-shadow: inset 0 1px 1px rgba(0,0,0,.05);
                	overflow-x: hidden;
                	overflow-y: hidden;
                }

                .scrollable {
                  overflow: scroll;
                }

                progress {
                	appearance: none;
                	-moz-appearance: none;
                	-webkit-appearance: none;

                	border: none;
                	height: 20px;
                	background-color: whiteSmoke;
                	border-radius: 3px;
                	box-shadow: 0 2px 3px rgba(0,0,0,.5) inset;
                	color: royalblue;
                	position: relative;
                	margin: 0 0 1.5em;
                }

                progress[value]::-webkit-progress-bar {
                	background-color: whiteSmoke;
                	border-radius: 3px;
                	box-shadow: 0 2px 3px rgba(0,0,0,.5) inset;
                }

                progress[value]::-webkit-progress-value {
                	position: relative;

                	background-size: 35px 20px, 100% 100%, 100% 100%;
                	border-radius:3px;
                }

                progress.active:not([value])::before {
                	background-position: 10%;
                	animation-name: stripes;
                	animation-duration: 3s;
                	animation-timing-function: linear;
                	animation-iteration-count: infinite;
                }

                progress[value]::-moz-progress-bar {
                	background-size: 35px 20px, 100% 100%, 100% 100%;
                	border-radius:3px;
                }

                progress:not([value])::-moz-progress-bar {
                	border-radius:3px;
                	background:
                	linear-gradient(-45deg, transparent 33%, rgba(0, 0, 0, 0.2) 33%, rgba(0, 0, 0, 0.2) 66%, transparent 66%) left/2.5em 1.5em;

                }

                progress.active:not([value])::-moz-progress-bar {
                	background-position: 10%;
                	animation-name: stripes;
                	animation-duration: 3s;
                	animation-timing-function: linear;
                	animation-iteration-count: infinite;
                }

                progress.active:not([value])::-webkit-progress-bar {
                	background-position: 10%;
                	animation-name: stripes;
                	animation-duration: 3s;
                	animation-timing-function: linear;
                	animation-iteration-count: infinite;
                }

                progress.primary[value]::-webkit-progress-value { background-color: #007bff; }
                progress.primary:not([value])::before { background-color: #007bff; }
                progress.primary:not([value])::-webkit-progress-bar { background-color: #007bff; }
                progress.primary::-moz-progress-bar { background-color: #007bff; }

                progress.secondary[value]::-webkit-progress-value { background-color: #6c757d; }
                progress.secondary:not([value])::before { background-color: #6c757d; }
                progress.secondary:not([value])::-webkit-progress-bar { background-color: #6c757d; }
                progress.secondary::-moz-progress-bar { background-color: #6c757d; }

                progress.success[value]::-webkit-progress-value { background-color: #28a745; }
                progress.success:not([value])::before { background-color: #28a745; }
                progress.success:not([value])::-webkit-progress-bar { background-color: #28a745; }
                progress.success::-moz-progress-bar { background-color: #28a745; }

                progress.danger[value]::-webkit-progress-value { background-color: #dc3545; }
                progress.danger:not([value])::before { background-color: #dc3545; }
                progress.danger:not([value])::-webkit-progress-bar { background-color: #dc3545; }
                progress.danger::-moz-progress-bar { background-color: #dc3545; }

                progress.warning[value]::-webkit-progress-value { background-color: #ffc107; }
                progress.warning:not([value])::before { background-color: #ffc107; }
                progress.warning:not([value])::-webkit-progress-bar { background-color: #ffc107; }
                progress.warning::-moz-progress-bar { background-color: #ffc107; }

                progress.info[value]::-webkit-progress-value { background-color: #17a2b8; }
                progress.info:not([value])::before { background-color: #17a2b8; }
                progress.info:not([value])::-webkit-progress-bar { background-color: #17a2b8; }
                progress.info::-moz-progress-bar { background-color: #17a2b8; }

                progress.light[value]::-webkit-progress-value { background-color: #f8f9fa; }
                progress.light:not([value])::before { background-color: #f8f9fa; }
                progress.light:not([value])::-webkit-progress-bar { background-color: #f8f9fa; }
                progress.light::-moz-progress-bar { background-color: #f8f9fa; }

                progress.dark[value]::-webkit-progress-value { background-color: #343a40; }
                progress.dark:not([value])::-webkit-progress-bar { background-color: #343a40; }
                progress.dark:not([value])::before { background-color: #343a40; }
                progress.dark::-moz-progress-bar { background-color: #343a40; }

                progress:not([value])::-webkit-progress-bar {
                	border-radius: 3px;
                	background:
                	linear-gradient(-45deg, transparent 33%, rgba(0, 0, 0, 0.2) 33%, rgba(0, 0, 0, 0.2) 66%, transparent 66%) left/2.5em 1.5em;
                }
                progress:not([value])::before {
                	content:" ";
                	position:absolute;
                	height: 20px;
                	top:0;
                	left:0;
                	right:0;
                	bottom:0;
                	border-radius: 3px;
                	background:
                	linear-gradient(-45deg, transparent 33%, rgba(0, 0, 0, 0.2) 33%, rgba(0, 0, 0, 0.2) 66%, transparent 66%) left/2.5em 1.5em;
                }

                @keyframes stripes {
                  from {background-position: 0%}
                  to {background-position: 100%}
                }
        </style>

          {"da5ff3ef-4f0f-439c-9339-1c646dd4ffd6":{"roots":{"references":[{"attributes":{"children":[{"id":"2219","type":"panel.models.markup.HTML"},{"id":"2220","type":"panel.models.markup.HTML"}],"margin":[0,0,0,0],"name":"Column04489"},"id":"2218","type":"Column"},{"attributes":{"children":[{"id":"2193","type":"Column"},{"id":"2198","type":"Tabs"}],"margin":[0,0,0,0],"name":"Column04534"},"id":"2192","type":"Column"},{"attributes":{"children":[{"id":"2194","type":"panel.models.markup.HTML"},{"id":"2195","type":"Row"}],"margin":[0,0,0,0],"name":"Column01327"},"id":"2193","type":"Column"},{"attributes":{"css_classes":["markdown"],"height":40,"margin":[0,0,0,0],"name":"Markdown01320","sizing_mode":"fixed","text":"&amp;lt;h1&amp;gt;The Reference Model Accumulates Knowledge with Human Interpretation&amp;lt;/h1&amp;gt;","width":1100},"id":"2194","type":"panel.models.markup.HTML"},{"attributes":{"children":[{"id":"2196","type":"panel.models.markup.HTML"},{"id":"2197","type":"panel.models.markup.HTML"}],"margin":[0,0,0,0],"name":"Row01326"},"id":"2195","type":"Row"},{"attributes":{"css_classes":["markdown"],"height":40,"margin":[0,0,0,0],"name":"Markdown01324","sizing_mode":"fixed","text":"&amp;lt;p&amp;gt;By: &amp;lt;a href=&amp;quot;http://sites.google.com/site/jacobbarhak/&amp;quot;&amp;gt;Jacob Barhak&amp;lt;/a&amp;gt;&amp;lt;/p&amp;gt;","width":150},"id":"2196","type":"panel.models.markup.HTML"},{"attributes":{"css_classes":["markdown"],"height":40,"margin":[0,0,0,0],"name":"Markdown01322","sizing_mode":"fixed","text":"&amp;lt;p&amp;gt;Venue: &amp;lt;a href=&amp;quot;https://www.imagwiki.nibib.nih.gov/resources/models-tools-databases&amp;quot;&amp;gt;Interagency Modeling and Analysis Group - IMAG wiki - MODELS, TOOLS &amp;amp;amp; DATABASES&amp;lt;/a&amp;gt; Uploaded 16 March 2020&amp;lt;/p&amp;gt;","width":950},"id":"2197","type":"panel.models.markup.HTML"},{"attributes":{"callback":null,"js_property_callbacks":{"change:active":[{"id":"2248","type":"CustomJS"}],"change:tabs":[{"id":"2249","type":"CustomJS"}]},"margin":[0,0,0,0],"tabs":[{"id":"2204","type":"Panel"},{"id":"2217","type":"Panel"},{"id":"2221","type":"Panel"},{"id":"2247","type":"Panel"}]},"id":"2198","type":"Tabs"},{"attributes":{"children":[{"id":"2200","type":"panel.models.markup.HTML"},{"id":"2201","type":"Row"}],"margin":[0,0,0,0],"name":"Column01335"},"id":"2199","type":"Column"},{"attributes":{"css_classes":["markdown"],"height":700,"margin":[5,5,5,5],"name":"Markdown01328","sizing_mode":"fixed","text":"&amp;lt;h2&amp;gt;BACKGROUND:&amp;lt;/h2&amp;gt;\n&amp;lt;h4&amp;gt;The Reference Model for disease progression is currently the most validated diabetes cardiovascular model known world-wide. Beyond predicting disease progression, it can show our cumulative gap of computational knowledge compared to more populations than any other published model was ever validated against, and many other models are incorporated in it. This year the model was improved with the ability to include human interpretation as input.&amp;lt;/h4&amp;gt;\n&amp;lt;h2&amp;gt;METHODS:&amp;lt;/h2&amp;gt;\n&amp;lt;h4&amp;gt;The Reference Model is an ensemble model that accumulates knowledge from multiple sources. Until this year, the model included 1) Risk models and assumptions, 2) Summary population data in the form or baseline population statistics and observed outcomes as extracted from clinical trials - mostly from ClinicalTrials.Gov. The model then optimized the model/assumption mixture to best match a fitness function. The optimization technique improved gradient descent method, typically used in machine learning to optimize neural networks, while using parallel computing and High Performance Computing. This year the model was improved with the ability to enter human interpretation of observed outcomes. This permits including multiple explanations from potentially different experts in a way that can be optimized with other factors. This technique allows the machine to handle data that is not very well defined such as medical outcomes may have multiple definitions and hence multiple interpretations. This technique also allows including human influence in an otherwise machine dominated computational process. The Reference Model interactive visualization was improved using new HoloViz Python technologies that allow embedding interactive plots in static web pages. This allows exploring results from the viewpoints of different human interpretations.&amp;lt;/h4&amp;gt;\n&amp;lt;h2&amp;gt;RESULTS:&amp;lt;/h2&amp;gt;\n&amp;lt;h4&amp;gt;The &amp;lt;a href=&amp;quot;https://jacob-barhak.github.io/InteractivePoster_MSM_IMAG_2019.html&amp;quot;&amp;gt;most fitting model in 2019 has achieved a fitness score of ~50/1000&amp;lt;/a&amp;gt;. In lay terms, with some simplifying assumptions, it means that our cumulative computational knowledge gap was about 5%. Adding multiple possible human interpretations of the data representing uncertainty of the author, allowed removing a clear outlier and improving average fitness in 2020 to ~36/1000 =3.6%, roughly meaning an improvement of 1.4% in the ability of computational methods to explain observed phenomena in clinical trials. Enhanced information on methods and results will appear in &amp;lt;a href=&amp;quot;https://www.modsimworld.org/&amp;quot;&amp;gt;MODSIM World 2020&amp;lt;/a&amp;gt;.&amp;lt;/h4&amp;gt;\n&amp;lt;h2&amp;gt;CONCLUSIONS:&amp;lt;/h2&amp;gt;\n&amp;lt;h4&amp;gt;The Reference Model now includes inputs that are: facts = observed data, assumptions = models, and human interpretations = expert opinion. And the new technologies now allow more human influence on the modeling process in ways not possible before. Moreover, it allows merging human understanding with machine comprehension, thus moving away from the accusation that computer models are similar to black boxes. Now non technical human experts can add their opinions to knowledge assembled by the model towards reduction of our cumulative computational knowledge gap.&amp;lt;/h4&amp;gt;","width":1100},"id":"2200","type":"panel.models.markup.HTML"},{"attributes":{"children":[{"id":"2202","type":"panel.models.markup.HTML"},{"id":"2203","type":"panel.models.markup.HTML"}],"margin":[0,0,0,0],"name":"Row01334"},"id":"2201","type":"Row"},{"attributes":{"css_classes":["markdown"],"height":250,"margin":[5,5,5,5],"name":"Markdown01332","sizing_mode":"fixed","text":"&amp;lt;h2&amp;gt;The Reference Model Key Points&amp;lt;/h2&amp;gt;\n&amp;lt;ul&amp;gt;\n&amp;lt;li&amp;gt;Ensemble model &amp;lt;/li&amp;gt;\n&amp;lt;li&amp;gt;Accumulates knowledge from:&amp;lt;ul&amp;gt;\n&amp;lt;li&amp;gt;Existing models &amp;lt;/li&amp;gt;\n&amp;lt;li&amp;gt;Observed outcomes&amp;lt;/li&amp;gt;\n&amp;lt;li&amp;gt;Expert interpretations&amp;lt;/li&amp;gt;\n&amp;lt;/ul&amp;gt;\n&amp;lt;/li&amp;gt;\n&amp;lt;li&amp;gt;Focuses on summary data &amp;lt;ul&amp;gt;\n&amp;lt;li&amp;gt;Avoids individual data restrictions&amp;lt;/li&amp;gt;\n&amp;lt;li&amp;gt;Larger merged population base&amp;lt;/li&amp;gt;\n&amp;lt;/ul&amp;gt;\n&amp;lt;/li&amp;gt;\n&amp;lt;li&amp;gt;Flexible Import from ClinicalTrials.Gov&amp;lt;/li&amp;gt;\n&amp;lt;li&amp;gt;Traceable and reproducible&amp;lt;/li&amp;gt;\n&amp;lt;li&amp;gt;Shows our computational knowledge gap&amp;lt;/li&amp;gt;\n&amp;lt;li&amp;gt;Currently focuses on diabetic populations&amp;lt;/li&amp;gt;\n&amp;lt;li&amp;gt;Uses High Performance Computing&amp;lt;/li&amp;gt;\n&amp;lt;li&amp;gt;Protected by U.S. Patent 9,858,390&amp;lt;/li&amp;gt;\n&amp;lt;/ul&amp;gt;","width":400},"id":"2202","type":"panel.models.markup.HTML"},{"attributes":{"css_classes":["markdown"],"height":250,"margin":[5,5,5,5],"name":"Markdown01330","sizing_mode":"fixed","text":"&amp;lt;p&amp;gt;&amp;lt;a title=&amp;quot;The Reference Model&amp;quot; target=&amp;quot;_blank&amp;quot; href=&amp;quot;https://simtk.org/projects/therefmodel&amp;quot;&amp;gt;&amp;lt;img src=&amp;quot;data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAACcQAAARMCAYAAAC9Rw  events via Comm\n  var events = unique_events(comm_status.event_buffer);\n  for (var i=0; i&lt;events.length; i++) {\n    var data = events[i];\n    var comm = window.PyViz.comms[data[\"comm_id\"]];\n    comm.send(data);\n  }\n  comm_status.event_buffer = [];\n}\n\nfunction on_msg(msg) {\n  // Receives acknowledgement from Python, processing event\n  // and unblocking Comm if event queue empty\n  var metadata = msg.metadata;\n  var comm_id = metadata.comm_id\n  var comm_status = window.PyViz.comm_status[comm_id];\n  if (comm_status.event_buffer.length) {\n    process_events(comm_status);\n    comm_status.blocked = true;\n    comm_status.time = Date.now()+50;\n  } else {\n    comm_status.blocked = false;\n  }\n  comm_status.event_buffer = [];\n  if ((metadata.msg_type == \"Ready\") &amp;&amp; metadata.content) {\n    console.log(\"Python callback returned following output:\", metadata.content);\n  } else if (metadata.msg_type == \"Error\") {\n    console.log(\"Python failed with the following traceback:\", metadata.traceback)\n  }\n}\n\n// Initialize Comm\nif ((window.PyViz == undefined) || (window.PyViz.comm_manager == undefined)) { return }\ncomm = window.PyViz.comm_manager.get_client_comm(\"2192\", \"d007fbf24dcf484796d2d5c69ba6fca8\", on_msg);\nif (!comm) {\n  return\n}\n\n// Initialize event queue and timeouts for Comm\nvar comm_status = window.PyViz.comm_status[\"d007fbf24dcf484796d2d5c69ba6fca8\"];\nif (comm_status === undefined) {\n  comm_status = {event_buffer: [], blocked: false, time: Date.now()}\n  window.PyViz.comm_status[\"d007fbf24dcf484796d2d5c69ba6fca8\"] = comm_status\n}\n\n// Add current event to queue and process queue if not blocked\nvar event_name = cb_obj.event_name;\nif (event_name === undefined) {\n  // we are a widget not an event... fake a key.\n  event_name = Object.keys(data).join(',');\n}\ndata['comm_id'] = \"d007fbf24dcf484796d2d5c69ba6fca8\";\ntimeout = comm_status.time + 20000;\nif ((comm_status.blocked &amp;&amp; (Date.now() &lt; ti ;/h3&amp;gt;\n&amp;lt;p&amp;gt;This presentation is accessible &amp;lt;a href=&amp;quot;https://jacob-barhak.github.io/Poster_MSM_IMAG_2020.html&amp;quot;&amp;gt;here&amp;lt;/a&amp;gt;. The code that generated the presentation can be accessed &amp;lt;a href=&amp;quot;https://github.com/Jacob-Barhak/Presentations/tree/master/MSM_IMAG2020&amp;quot;&amp;gt;here&amp;lt;/a&amp;gt;. This presentation is generated using Python 2.7.16, panel-0.8.0, holoviews 1.12.7, bokeh-1.4.0.\nResults presented in this poster were extracted from a simulation executed on a 64 core machine using Ubuntu 18.04.01 LTS with python 2.7.15 delivered by Anaconda with dask 0.19.1 supporting multi processing and MIST 0.94.6.0 as the simulation engine. The simulation results was archived under the file MIST_RefModel_2020_01_16_OPTIMIZE.zip. Formula Validation run to validate integrity was archived as MIST_RefModel_2020_01_02_FORMULA.zip. Result visualization was generated on a notebook machine using Windows 10 x64 with Python 2.7.16, Bokeh: 1.4.0, Holoviews: 1.12.7. The code/data files ExploreOptimizationResults_2020_02_07.py / ExploreOptimizationResults_2020_02_07.yaml were used to generate the visualization. Thia version of simulation contains one known error of one outcome misplacement as another out of 120 outcomes. &amp;lt;/p&amp;gt;","width":700},"id":"2243","type":"panel.models.markup.HTML"},{"attributes":{"css_classes":["markdown"],"height":50,"margin":[5,5,5,5],"name":"Markdown04516","sizing_mode":"fixed","text":"&amp;lt;p&amp;gt;&amp;lt;a title=&amp;quot;J. Barhak, The Reference Model Uses Modular Population Generation! Object Oriented Population Generation on the Fly with MIST. IMAG Multiscale Modeling (MSM) Consortium Meeting  9-10 September 2015&amp;quot; target=&amp;quot;_blank&amp;quot; href=&amp;quot;http://sites.google.com/site/jacobbarhak/home/PosterModularPopulationGeneration_IMAG_MSM2015_Upload_2015_09_03.pdf&amp;quot;&amp;gt;&amp;lt;img src=&amp;quot;data:image/png;base64,iVBORw Kx35TkQsAXKX1k/h0Ss7nIpfcc7MoEohtABEs4saGgGiTbL7M79G/kUvur3I3qTZhkxpZ+qBzVX0TmdBp9WVfL5ukM3MA+jdyyf0FrrzGhJJrD5muIm3n6fceMsU2brsU+WI7eHh+ALnk3rdUpE5nJlqS0iaZxMgFAF6Ys3q3JSlZDyCX3Pt2yE+2ea+unrzBNJ8xjP3Rbxojhbh+I5fcMxP9+DP/wJZnew7kkksuueSSSy655JJLLrn/de7fUJ+ColNWz2oAAAAASUVORK5CYII=&amp;quot; alt=&amp;quot;J. Barhak, Generating Populations for Micro Simulation from Publicly Available Data - Populations in the MIST! IMAG Multiscale Modeling (MSM) Consortium Meeting  3-4 September 2014.&amp;quot; width=&amp;quot;50&amp;quot;/&amp;gt; &amp;lt;/a&amp;gt;&amp;lt;/p&amp;gt;","width":50},"id":"2238","type":"panel.models.markup.HTML"},{"attributes":{"css_classes":["markdown"],"height":300,"margin":[5,5,5,5],"name":"Markdown04482","sizing_mode":"fixed","text":"&amp;lt;h2&amp;gt;What is New this year?&amp;lt;/h2&amp;gt;\n&amp;lt;h3&amp;gt;Problem:&amp;lt;/h3&amp;gt;\n&amp;lt;ul&amp;gt;\n&amp;lt;li&amp;gt;Outcomes of published studies are typically published as text rather than exact codes. &amp;lt;/li&amp;gt;\n&amp;lt;li&amp;gt;Even when published with specific definitions such as &amp;lt;a href=&amp;quot;https://en.wikipedia.org/wiki/International_Statistical_Classification_of_Diseases_and_Related_Health_Problems&amp;quot;&amp;gt;ICD codes&amp;lt;/a&amp;gt;, they are hard to compare between publications due to version issues and bundled outcomes.&amp;lt;/li&amp;gt;\n&amp;lt;li&amp;gt;Furthermore medical definitions change within time making it hard to compare data from different times. &amp;lt;a href=&amp;quot;https://arxiv.org/ftp/arxiv/papers/1609/1609.07214.pdf&amp;quot;&amp;gt;Sepsis evolving definitions&amp;lt;/a&amp;gt; is a good example.&amp;lt;/li&amp;gt;\n&amp;lt;li&amp;gt;Outcomes with multiple definitions are rarely published like in the &amp;lt;a href=&amp;quot;https://clinicaltrials.gov/ct2/show/results/NCT00379769&amp;quot;&amp;gt;RECORD study&amp;lt;/a&amp;gt;:                      &amp;lt;/li&amp;gt;\n&amp;lt;/ul&amp;gt;\n&amp;lt;h3&amp;gt;Solution:&amp;lt;/h3&amp;gt;\n&amp;lt;ul&amp;gt;\n&amp;lt;li&amp;gt;\n&amp;lt;p&amp;gt;Incorporate human interpretation of outcomes as input&amp;lt;/p&amp;gt;\n&amp;lt;ul&amp;gt;\n&amp;lt;li&amp;gt;Six expert opinions were imitated by the author &amp;lt;/li&amp;gt;\n&amp;lt;li&amp;gt;Opinions represent strict = no change, conservative, and liberal&amp;lt;/li&amp;gt;\n&amp;lt;/ul&amp;gt;\n&amp;lt;/li&amp;gt;\n&amp;lt;li&amp;gt;\n&amp;lt;p&amp;gt;Integrate it with optimization with other components&amp;lt;/p&amp;gt;\n&amp;lt;ul&amp;gt;\n&amp;lt;li&amp;gt;Models, assumptions and interpretations influence on fitness are considered&amp;lt;/li&amp;gt;\n&amp;lt;li&amp;gt;Opinions represent strict = no change, conservative, and liberal&amp;lt;/li&amp;gt;\n&amp;lt;li&amp;gt;The algorithm can reject interpretations that do not match observed data &amp;lt;/li&amp;gt;\n&amp;lt;li&amp;gt;The algorithm highlights the best experts&amp;lt;/li&amp;gt;\n&amp;lt;/ul&amp;gt;\n&amp;lt;/li&amp;gt;\n&amp;lt;li&amp;gt;\n&amp;lt;p&amp;gt;This is an improvement over the &amp;lt;a href=&amp;quot;https://en.wikipedia.org/wiki/Delphi_method&amp;quot;&amp;gt;Delphi method&amp;lt;/a&amp;gt; since it includes machine learning components&amp;lt;/p&amp;gt;\n&amp;lt;ul&amp;gt;\n&amp;lt;li&amp;gt;Experts present their opinions once and the machine performs iterations&amp;lt;/li&amp;gt;\n&amp;lt;li&amp;gt;Easily scalable to many experts&amp;lt;/li&amp;gt;\n&amp;lt;li&amp;gt;Can be repeated while comparing interpretations&amp;lt;/li&amp;gt;\n&amp;lt;li&amp;gt;Provides a combined cumulative interpretation&amp;lt;/li&amp;gt;\n&amp;lt;/ul&amp;gt;\n&amp;lt;/li&amp;gt;\n&amp;lt;/ul&amp;gt;","width":1100},"id":"2216","type":"panel.models.markup.HTML"},{"attributes":{"child":{"id":"2212","type":"panel.models.markup.HTML"},"name":"Markdown04479","title":"Equations"},"id":"2213","type":"Panel"},{"attributes":{"css_classes":["markdown"],"height":450,"margin":[5,5,5,5],"name":"Markdown04479","sizing_mode":"fixed","text":"&amp;lt;p&amp acebook Headquarters&amp;quot; width=&amp;quot;50&amp;quot;/&amp;gt; &amp;lt;/a&amp;gt;&amp;lt;/p&amp;gt;","width":50},"id":"2227","type":"panel.models.markup.HTML"},{"attributes":{"css_classes":["markdown"],"height":500,"margin":[5,5,5,5],"name":"Markdown04485","sizing_mode":"fixed","text":"&amp;lt;h2&amp;gt;Results&amp;lt;/h2&amp;gt;\n&amp;lt;p&amp;gt;The 3 plots represent results obtained after 3 weeks of simulation on a 64 core machine. Interactive result exploration is possible through 3 widgets:&amp;lt;/p&amp;gt;\n&amp;lt;h3&amp;gt;Widgets:&amp;lt;/h3&amp;gt;\n&amp;lt;ul&amp;gt;\n&amp;lt;li&amp;gt;&amp;lt;strong&amp;gt;Display:&amp;lt;/strong&amp;gt; controls what the circle size and circle color mean in the population validation plot. Changing this option helps visually explore the populations. &amp;lt;/li&amp;gt;\n&amp;lt;li&amp;gt;&amp;lt;strong&amp;gt;Iteration:&amp;lt;/strong&amp;gt; controls which optimization iteration is displayed - the optimal results appear in iteration 30.&amp;lt;/li&amp;gt;\n&amp;lt;li&amp;gt;&amp;lt;strong&amp;gt;Interpretation:&amp;lt;/strong&amp;gt; shows the perspective of different possible interpretations of outcomes observed in clinical trials after correction. The &amp;amp;ldquo;Combined&amp;amp;rdquo; option shows the merged interpretations. Changing this widget to a numeric value shows the results from the view of a specific &amp;amp;ldquo;expert&amp;amp;rdquo; opinion imitated in this simulation. &amp;lt;/li&amp;gt;\n&amp;lt;/ul&amp;gt;\n&amp;lt;h3&amp;gt;Plots:&amp;lt;/h3&amp;gt;\n&amp;lt;ul&amp;gt;\n&amp;lt;li&amp;gt;&amp;lt;strong&amp;gt;Population Validation - (upper left):&amp;lt;/strong&amp;gt; Shows each clinical trial in a different column. Each circle represents one cohort from the clinical trial. Hovering over the circle will show statistics of the modeled cohort in a pop-up window. The height of the circle represents the fitness score which is a measure of the modeling error. Low fitness means that the model agreed with trial results while high fitness represented by circles near the top represent cases where simulation results do not match observed outcomes. &amp;lt;/li&amp;gt;\n&amp;lt;li&amp;gt;&amp;lt;strong&amp;gt;Convergence - (upper right):&amp;lt;/strong&amp;gt; Shows the combined wighted fitness for each iteration. The large circles represent the model without perturbation, the smaller circles represent gradient perturbations and the red wide dashes represent the mean fitness for the iteration considering all perturbations. A vertical blue line reminds the viewer of each iteration is shown in the other plots. The plot shows a clear convergence of the optimization algorithm. The converged fitness represents our cumulative knowledge gap.&amp;lt;/li&amp;gt;\n&amp;lt;li&amp;gt;&amp;lt;strong&amp;gt;Model Mixture - (lower left):&amp;lt;/strong&amp;gt; Each column represents a different model / assumption. The height of each bar represents the influence of this model / assumption on the ensemble model in the current iteration. Initially all models/assumptions have equal influence. Columns that their bars disappear with iteration represent  equations rejected by the model. The right most cyan bars represent assumptions contributed by different interpretations of the outcome data, Some imitated interpretations are eventually rejected.  &amp;lt;/li&amp;gt;\n&amp;lt;/ul&amp;gt;","width":1000},"id":"2219","type":"panel.models.markup.HTML"},{"attributes":{"callback":null,"height":450,"js_property_callbacks":{"change:active":[{"id":"2214","type":"CustomJS"}],"change:tabs":[{"id":"2215","type":"CustomJS"}]},"margin":[0,0,0,0],"sizing_mode":"fixed","tabs":[{"id":"2209","type":"Panel"},{"id":"2211","type":"Panel"},{"id":"2213","type":"Panel"}],"width":1200},"id":"2207","type":"Tabs"}],"root_ids":["2192"]},"title":"Bokeh Application","version":"1.4.0"}}
